class Solution {
  int continuousSubarrays(List<int> nums) {
    int total = 0;
    int start = 0;

    for (int end = 0; end < nums.length; end++) {
      // Iterate through the window from the start to the current end
      // to ensure all elements satisfy the continuity condition
      for (int i = start; i < end; i++) {
        // If the condition is violated for any pair, adjust the start
        if ((nums[end] - nums[i]).abs() > 2) {
          start = i + 1;
        }
      }
      // The number of continuous subarrays ending with the current element
      // is the window size
      total += end - start + 1;
    }
    return total;
  }
}
